const LOGIN_ROUTE ='./pages/login'
const CREATE_ROUTE = './pages/modal'
import Login from "./pages/Login";
import Modal from ".pages/Modal"

export const publicRoutes=[
    {
        path:LOGIN_ROUTE,
        Component:Login
    }
]

export const privateRoutes = [{
    path: CREATE_ROUTE,
    Component: Modal
}]
